    return (
        <div className='map-container'>

            <Area1 />
            <Area2 />
            <Area3 />
            <Area4 />
            <Area5 />
            <Area6 />
            <Area7 />
            <Area8 />
            <Area9 />


        </div>
    )
}

export default Map
